import React from 'react';
import { Col, Container, Image, Navbar, } from 'react-bootstrap';
import Logo from '../assets/images/logoW.png'
import ReactFullpage from '@fullpage/react-fullpage';
import Background from '../assets/images/Background.png'
import Layout from '../components/Layout'
import Navigation from '../components/Navigation'

function Welcome() {
    const menu = () => {
        return (
            <ul id="myMenu">
                <li data-menuanchor="firstPage" class="active"><a href="#firstPage">First section</a></li>
                <li data-menuanchor="secondPage"><a href="#secondPage">Second section</a></li>
                <li data-menuanchor="thirdPage"><a href="#thirdPage">Third section</a></li>
                <li data-menuanchor="fourthPage"><a href="#fourthPage">Fourth section</a></li>
            </ul>)
    }
    const anchors = ['firstPage', 'secondPage', 'thirdPage', 'fourthPage', 'lastPage']
    return (

        <ReactFullpage
            //fullpage options
            anchors={anchors}
            menu={menu}
            render={({ state, fullpageApi }) => {
                return (
                    <ReactFullpage.Wrapper >
                        <Col className="section" style={{
                            backgroundImage: `url(${Background})`, backgroundSize: 'cover', width: window.innerWidth,
                            height: window.innerHeight - 100
                        }}>
                            {/* <Navigation/> */}
                        </Col>

                        <div className="section">
                            <p>Section 2</p>
                        </div>
                    </ReactFullpage.Wrapper>
                );
            }}
        />




    )


}
export default Welcome
